/**
 * @brief           SM9  verify speed test
 * @return          0 for success, 1 for failure
 */
unsigned int sm9_sign_verify_test(void)
{
    unsigned char ks[32];
    unsigned char msg[20] = {0x43, 0x68, 0x69, 0x6E, 0x65, 0x73, 0x65, 0x20, 0x49, 0x42, 0x53, 0x20, 0x73, 0x74, 0x61, 0x6E, 0x64, 0x61, 0x72, 0x64};
    unsigned char ida[5]  = {0x41, 0x6C, 0x69, 0x63, 0x65};
    unsigned char hid     = 0x01;
    unsigned char h[32];
    unsigned char S[65];
    unsigned char Ppub_s[128];
    unsigned char dsA[64];

    unsigned int i, ret;

    printf("\r\n -------------- SM9 sig test -------------- \r\n");
    fflush(stdout);

    // printf("\r\n begin \r\n");fflush(stdout);
    // for(int j=0;j<30;j++){
    ret = sm9_sign_gen_mastKeyPair(ks, Ppub_s);
    //}printf("\r\n end \r\n");fflush(stdout);
    if (SM9_SUCCESS != ret) {
        printf("\r\n sm9_sign_gen_mastKeyPair failure, ret=%x", ret);
        return 1;
    } else {
        printf("\r\n sm9_sign_gen_mastKeyPair success");
        fflush(stdout);
    }

    // for(int j=0;j<300;j++){
    ret |= sm9_sign_gen_userPriKey(ida, 5, hid, ks, dsA);
    //}printf("\r\n end \r\n");fflush(stdout);
    if (SM9_SUCCESS != ret) {
        printf("\r\n sm9_sign_gen_userPriKey failure, ret=%x", ret);
        return 1;
    } else {
        printf("\r\n sm9_sign_gen_userPriKey success");
        fflush(stdout);
    }

    for (i = 0; i < 3; i++) {
        memset_(h, 0, sizeof(h));
        memset_(S, 0, sizeof(S));
        // printf("\r\n sign begin \r\n");fflush(stdout);
        // for(int j=0;j<3;j++){
        ret = sm9_sign(msg, 20, NULL, Ppub_s, dsA, NULL, h, S);
        //}printf("\r\n sign end \r\n");fflush(stdout);
        if (SM9_SUCCESS != ret) {
            printf("\r\n sm9_sign failure %u, ret=%x", i, ret);
            return 1;
        } else {
            printf("\r\n sm9_sign success %u", i);
            fflush(stdout);
        }
#if 0
        print_buf_u8(ks, 32, "ks");
        print_buf_u8(Ppub_s, 128, "Ppub_s");
        print_buf_u8(dsA, 64, "dsA");
        print_buf_u8(h, 32, "h");
        print_buf_u8(S, 65, "S");
#endif
        // printf("\r\n verify begin \r\n");fflush(stdout);
        // for(int j=0;int<3;int++){
        ret = sm9_verify(msg, 20, ida, 5, hid, NULL, Ppub_s, h, S);
        //}printf("\r\n verify end \r\n");fflush(stdout);
        if (SM9_SUCCESS != ret) {
            printf("\r\n sm9_sign veri failure %u, ret=%x", i, ret);
            return 1;
        } else {
            printf("\r\n sm9_sign veri success %u", i);
            fflush(stdout);
        }
    }

    return 0;
}

