/**
 * @brief           SM9   calculate precomputed values for pairing operation
 * @param[in]       P1                   - First point input for pairing calculation
 * @param[in]       P2                   - Second point input for pairing calculation
 * @param[out]      g                    - Output buffer for precomputed values
 * @return          0 for success, 1 for failure
 */
unsigned int sm9_test_get_pre_calc_g(unsigned char P1[64], unsigned char P2[128], unsigned char *g)
{
#if (SM9_FP12_EXP_COMB_PARTS > 1)
    unsigned char r[32];
#endif
    unsigned int ret;

    ret = sm9_pairing_calc(P1, P2, g);
    if (SM9_SUCCESS != ret) {
        printf("\r\n sm9_pairing_calc failure, ret=%x", ret);
        return 1;
    }

#if (SM9_FP12_EXP_COMB_PARTS == 2)
    // r = 2^128;
    memset_(r, 0, 32);
    r[15] = 1;
    ret   = sm9_fp12_exp(g, r, g + 32 * 12);
    if (SM9_SUCCESS != ret) {
        printf("\r\n sm9_fp12_exp failure 1, ret=%x", ret);
        return 1;
    }

    // r = 2^128 + 1;
    r[31] = 1;
    ret   = sm9_fp12_exp(g, r, g + 32 * 12 * 2);
    if (SM9_SUCCESS != ret) {
        printf("\r\n sm9_fp12_exp failure 2, ret=%x", ret);
        return 1;
    }
#elif (SM9_FP12_EXP_COMB_PARTS == 3)
    // r = 2^86;
    memset_(r, 0, 32);
    r[21] = 0x40;
    ret   = sm9_fp12_exp(g, r, g + 32 * 12);
    if (SM9_SUCCESS != ret) {
        printf("\r\n sm9_fp12_exp failure 1, ret=%x", ret);
        return 1;
    }

    // r = 2^86 + 1;
    r[31] = 1;
    ret   = sm9_fp12_exp(g, r, g + 32 * 12 * 2);
    if (SM9_SUCCESS != ret) {
        printf("\r\n sm9_fp12_exp failure 2, ret=%x", ret);
        return 1;
    }

    // r = 2^172;
    memset_(r, 0, 32);
    r[10] = 0x10;
    ret   = sm9_fp12_exp(g, r, g + 32 * 12 * 3);
    if (SM9_SUCCESS != ret) {
        printf("\r\n sm9_fp12_exp failure 3, ret=%x", ret);
        return 1;
    }

    // r = 2^172 + 1;
    r[31] = 1;
    ret   = sm9_fp12_exp(g, r, g + 32 * 12 * 4);
    if (SM9_SUCCESS != ret) {
        printf("\r\n sm9_fp12_exp failure 4, ret=%x", ret);
        return 1;
    }

    // r = 2^172 + 2^86;
    r[31] = 0;
    r[21] = 0x40;
    ret   = sm9_fp12_exp(g, r, g + 32 * 12 * 5);
    if (SM9_SUCCESS != ret) {
        printf("\r\n sm9_fp12_exp failure 5, ret=%x", ret);
        return 1;
    }

    // r = 2^172 + 2^86 + 1;
    r[31] = 1;
    ret   = sm9_fp12_exp(g, r, g + 32 * 12 * 6);
    if (SM9_SUCCESS != ret) {
        printf("\r\n sm9_fp12_exp failure 6, ret=%x", ret);
        return 1;
    }
#endif

    return 0;
}

