    for (i = 0; i < round; i++) {
        ret |= sm9_enc(idb, 3, hid, msg, Msglen, NULL, Ppub_e, NULL, SM9_ENC_KDF_STREAM_CIPHER, SKE_NO_PADDING, K2len, Res_SM3, &clen);
    }

#ifdef SM9_SPEED_TEST_BY_TIMER
    endp(1, 0, round);
#else
    printf("\r\n finished");
    fflush(stdout);
#endif

    if ((SM9_SUCCESS != ret) || (clen != (96 + Msglen))) {
        printf("\r\n sm9_enc_sm3 failure Msglen=%u, ret=%x", Msglen, ret);
        fflush(stdout);
        return 1;
    }

    // test sm9_dec_sm3
    memset_(Plain_SM3, 0x5a, sizeof(Plain_SM3));
    round = dec_round;
    ret   = 0;
    printf("\r\n ======== sm9_dec_sm3 begin ======== ");
    fflush(stdout);

#ifdef SM9_SPEED_TEST_BY_TIMER
    // round /= 10;
    startp();
#endif

    for (i = 0; i < round; i++) {
        ret |= sm9_dec(idb, 3, Res_SM3, clen, deB, SM9_ENC_KDF_STREAM_CIPHER, SKE_NO_PADDING, K2len, Plain_SM3, &Plainlen);
    }

#ifdef SM9_SPEED_TEST_BY_TIMER
    endp(1, 0, round);
#else
    printf("\r\n finished");
    fflush(stdout);
#endif

    if ((SM9_SUCCESS != ret) || (Plainlen != Msglen) || memcmp_(msg, Plain_SM3, Plainlen)) {
        printf("\r\n sm9_dec_sm3 failure Msglen=%u, ret=%x", Msglen, ret);
        return 1;
    }

    // test sm9_enc_sm4
    Msglen = 32;
    memset_(Res_SM4, 0x1c, sizeof(Res_SM4));
    round = enc_round;
    ret   = 0;
    printf("\r\n ======== sm9_enc_sm4 begin ======== ");
    fflush(stdout);

#ifdef SM9_SPEED_TEST_BY_TIMER
    // round /= 10;
    startp();
#endif

